import React from 'react';
import { Container, Segment, Form, TextArea, Button } from 'semantic-ui-react';
import Head from 'next/head';
import Header from './Header';


class landingPage extends React.Component{
	render(){

		return(
			<Container style={{width:'1230px'}}>
			  <Header/>

			    <Segment>
					 <h1> QUIKK Smart Contract Auditor</h1>
					 <h4 style ={{color:'grey'}}> light, open-source smart contract auditor for ethereum</h4>
					 <Form>
					 <TextArea style ={{height:'500px'}} placeholder="Paste your smart contract code here..."/>

					 <Button primary style ={{marginLeft:'900px'}}>
					 Submit
					 </Button>
					 </Form>
				 </Segment>

		  </Container>
		  )

	}
}

export default landingPage;
